import React, { Component } from "react";

class HeaderLogin extends Component {
  constructor() {
    super();
    this.state = {
      product: [{ name: "jau", id: 1 }, { name: "andres", id: 2 }]
    };
  }

  render() {
    const _product = this.state.product.map((_product, i) => {
      return <div>{_product.name}</div>;
    });

    return (
      <div>
        <h1>Shpiing for ...</h1>
        <p>Demo...</p>
        <label>Nav</label>

        {_product}
      </div>
    );
  }
}

export default HeaderLogin;
